import React from "react";
import { Link } from "react-router-dom";  // React Router for navigation
import { Link as ScrollLink } from "react-scroll";  // React Scroll for smooth scrolling
import "../styles/Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">Trail Riders</div>
      <ul className="nav-links">
        <li><Link to="/">Home</Link></li>
        <li><ScrollLink to="events" smooth={true} duration={5}>Events</ScrollLink></li>
        <li><ScrollLink to="rides" smooth={true} duration={5}>Rides</ScrollLink></li>
        <li><ScrollLink to="blogs" smooth={true} duration={5}>Blogs</ScrollLink></li>
        <li><ScrollLink to="gallery" smooth={true} duration={5}>Gallery</ScrollLink></li>
        <li><ScrollLink to="shop" smooth={true} duration={5}>Shop</ScrollLink></li>
        <li><ScrollLink to="contact" smooth={true} duration={5}>Contact</ScrollLink></li>
      </ul>
      <div className="auth-buttons">
        <Link to="/login" className="login-btn">Login</Link>
        <Link to="/signup" className="signup-btn">Signup</Link>
      </div>
    </nav>
  );
};

export default Navbar;
